class App extends Component {
  render() {
    return (
      <div className="App">
        <Particles className='particles' style={{ position: "absolute" }}
  height="95%"
  width="95%"
  params={{
    particles: {
      color: {
        value: "#000000"
      },
      line_linked: {
        color: {
          value: "#000000"
        }
      },
      number: {
        value: 50
      },
      size: {
        value: 3
      }
    }
  }}
          // params = {particleOptions} 
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
                   {/* <FaceRecognition /> */}
      </div>
    );
  } 
}

export default App;
